            <div className="row text-center ">
                <div className="col-2"></div>
                <div className="col-8">
                <h1 className="mt-5">The Science of <b className="bold-text">Visual Habits</b></h1>
                <p className="fs-5 mt-3">Discover why simple grids are more powerful than complex systems. Learn the psychology behind visual tracking and how to build habits that actually stick.</p>
                <button className="btn  m-3 p-2 coloured-btn">Read Our Latest Article</button>
                <button className="btn btn-outline-secondary m-2 p-2" >Start Your Grid</button>
                </div>
                <div className="col-2"></div>
            </div>
        </div>
        </div>
        </>
     );
}

export default Component1;
